requests.postData:
{"operationName":"BEHAVIOR_QUERY","query":"query BEHAVIOR_QUERY {
      behavior {
        matchedFeatures {
          edges {
            node {
              name
            }
          }
        }
        matchedExperiments {
          edges {
            node {
              id
              name
              variation
            }
          }
        }
      }
    }"}

{"operationName":"METADATA_QUERY","variables":{"uri":"/video/x16ypbf"},"query":"query METADATA_QUERY($uri: String!) {
  views {
    id
    neon {
      id
      web(uri: $uri) {
        id
        author
        description
        title
        metadatas {
          attributes {
            name
            content
            __typename
          }
          __typename
        }
        language {
          codeAlpha2
          __typename
        }
        country {
          codeAlpha2
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}

{"operationName":"WATCHING_VIDEO","variables":{"xid":"x16ypbf"},"query":"query WATCHING_VIDEO($xid: String!) {
  video(xid: $xid) {
    __typename
    id
    xid
    title
    description
    thumbnail: thumbnailURL(size: "x240")
    thumbnailx60: thumbnailURL(size: "x60")
    thumbnailx120: thumbnailURL(size: "x120")
    thumbnailx240: thumbnailURL(size: "x240")
    thumbnailx720: thumbnailURL(size: "x720")
    thumbURLx60: thumbnailURL(size: "x60")
    thumbURLx120: thumbnailURL(size: "x120")
    thumbURLx240: thumbnailURL(size: "x240")
    thumbURLx360: thumbnailURL(size: "x360")
    thumbURLx480: thumbnailURL(size: "x480")
    thumbURLx720: thumbnailURL(size: "x720")
    thumbURLx1080: thumbnailURL(size: "x1080")
    category
    bestAvailableQuality
    viewCount
    duration
    createdAt
    isInWatchLater
    isLiked
    isPrivate
    isWatched
    isExplicit
    canDisplayAds
    embedHtml
    videoWidth: width
    videoHeight: height
    stats {
      views {
        total
        __typename
      }
      __typename
    }
    channel {
      __typename
      id
      xid
      name
      displayName
      isArtist
      logoURLx25: logoURL(size: "x25")
      logoURL(size: "x60")
      isFollowed
      accountType
      coverURLx375: coverURL(size: "x375")
      stats {
        views {
          total
          __typename
        }
        followers {
          total
          __typename
        }
        videos {
          total
          __typename
        }
        __typename
      }
      country {
        codeAlpha2
        __typename
      }
      organization {
        xid
        owner {
          xid
          __typename
        }
        __typename
      }
    }
    language {
      codeAlpha2
      __typename
    }
    tags {
      edges {
        node {
          label
          __typename
        }
        __typename
      }
      __typename
    }
    moderation {
      reviewedAt
      __typename
    }
    topics(whitelistedOnly: true, first: 3, page: 1) {
      edges {
        node {
          id
          xid
          name
          names {
            edges {
              node {
                name
                language {
                  codeAlpha2
                  __typename
                }
                __typename
              }
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    geoblockedCountries {
      allowed
      denied
      __typename
    }
    collections(first: 100, page: 1) {
      edges {
        node {
          id
          xid
          name
          __typename
        }
        __typename
      }
      __typename
    }
  }
  videoOrLive(xid: $xid) {
    __typename
    ... on Live {
      startAt
      endAt
      __typename
    }
  }
}
"}

{"operationName":"DISCOVERY_QUEUE_QUERY","variables":{"collectionXid":null,"videoXid":"x16ypbf"},"query":"query DISCOVERY_QUEUE_QUERY($videoXid: String!, $collectionXid: String, $device: String, $videoCountPerSection: Int) {
  views {
    id
    neon {
      id
      sections(device: $device, space: "watching", followingChannelXids: [], followingTopicXids: [], watchedVideoXids: [], context: {mediaXid: $videoXid, collectionXid: $collectionXid}, first: 20) {
        edges {
          node {
            name
            groupingType
            relatedComponent {
              ... on Channel {
                __typename
                id
                xid
                name
                displayName
                logoURL(size: "x60")
                logoURLx25: logoURL(size: "x25")
              }
              ... on Topic {
                __typename
                id
                xid
                name
                names {
                  edges {
                    node {
                      name
                      language {
                        codeAlpha2
                        __typename
                      }
                      __typename
                    }
                    __typename
                  }
                  __typename
                }
              }
              ... on Collection {
                __typename
                id
                xid
                name
              }
              __typename
            }
            components(first: $videoCountPerSection) {
              metadata {
                algorithm {
                  name
                  version
                  uuid
                  __typename
                }
                __typename
              }
              edges {
                node {
                  ... on Video {
                    __typename
                    id
                    xid
                    title
                    duration
                    thumbnailx60: thumbnailURL(size: "x60")
                    thumbnailx120: thumbnailURL(size: "x120")
                    thumbnailx240: thumbnailURL(size: "x240")
                    thumbnailx720: thumbnailURL(size: "x720")
                    channel {
                      id
                      xid
                      accountType
                      displayName
                      logoURLx25: logoURL(size: "x25")
                      logoURL(size: "x60")
                      __typename
                    }
                  }
                  ... on Channel {
                    __typename
                    id
                    xid
                    name
                    displayName
                    accountType
                    logoURL(size: "x60")
                  }
                  __typename
                }
                __typename
              }
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
